import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
// import * from "react-bootstrap";
import "./headers.css"
import {Button, Form, FormControl, Image, Nav, Navbar, NavDropdown} from "react-bootstrap";

class Header extends Component {
    constructor(props) {
        super(props);
        this.state = {
            logged_in: props.logged_in
        };
    }

    render() {
        let header;
        if (!this.state.logged_in) {
            header = (
                <Navbar bg="dark" variant="dark" expand="lg" sticky={"top"}>
                    <Navbar.Brand href="#home">WinDrop</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                            <Nav.Link href="#home">Home</Nav.Link>
                            <Nav.Link href="#link">FAQs</Nav.Link>
                            <Nav.Link href="#link">About</Nav.Link>
                            {/*<NavDropdown title="Dropdown" id="basic-nav-dropdown">*/}
                            {/*    <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>*/}
                            {/*    <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>*/}
                            {/*    <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>*/}
                            {/*    <NavDropdown.Divider />*/}
                            {/*    <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>*/}
                            {/*</NavDropdown>*/}
                        </Nav>
                        <Nav className="justify-content-end">
                            <Button variant={"outline-primary"} href={"#"}>Login</Button>
                            <Button variant={"primary"} href={"#"}>Sign-up</Button>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>
            );
        }
        else{
            header = (
                <Navbar bg="dark" variant="dark" expand="lg" sticky={"top"}>
                    <Navbar.Brand href="#home">WinDrop</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                            <Nav.Link href="#home">Home</Nav.Link>
                            <Nav.Link href="#link">FAQs</Nav.Link>
                            <Nav.Link href="#link">About</Nav.Link>
                            {/*<NavDropdown title="Dropdown" id="basic-nav-dropdown">*/}
                            {/*    <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>*/}
                            {/*    <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>*/}
                            {/*    <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>*/}
                            {/*    <NavDropdown.Divider />*/}
                            {/*    <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>*/}
                            {/*</NavDropdown>*/}
                        </Nav>
                        <Nav pullRight>
                            <NavDropdown eventKey={1} id="basic-nav-dropdown"
                            title={
                                <Image src={"public/logo192.png"}/>
                            }>

                                <MenuItem eventKey={1.1} href="/profile">Profile</MenuItem>
                                <MenuItem divider />
                                <MenuItem eventKey={1.3}>
                                    <i className="fa fa-sign-out"></i> Logout
                                </MenuItem>
                            </NavDropdown>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>
            );
        }
        return (
            header
        );
    }
}

export { Header };
